<div id="logo">
	<div id="logo_a"><div id="logo_b"></div></div>
	<h1>
		<span id="php_logo">
			<img src="data:image/png;base64," alt="Thies C. Arntzen">
		</span>
		<span id="php_text">PHP</span>-JS-CSS web toolkit
	</h1>
</div>
<style>
	#logo {
		overflow: auto;
		display: flex;
		align-items: center;
		justify-content: center;
	}
	#logo #logo_a {
		background-image: url("data:image/png;base64,");
		width: 300px;
		height: 300px;
		float: left;
	}
	#logo #logo_a #logo_b {
		background-image: url("data:image/png;base64,");
		width: 300px;
		height: 300px;
		visibility: hidden;
	}
	#logo #php_logo {
		display: none;
		margin: 0;
	}
	@media(prefers-color-scheme: dark) {
		#logo #logo_a {
			filter: invert(100%);
		}
	}
</style>
<script>
	document.addEventListener('DOMContentLoaded', function(){
		document.getElementById('logo_a').addEventListener('mouseover', function(){
			this.children[0].style.visibility='visible';
		});
		document.getElementById('logo_a').addEventListener('mouseout', function(){
			this.children[0].style.visibility='hidden';
		});
		document.getElementById('php_text').addEventListener('click', function(){
			this.style.display='none';
			document.getElementById('php_logo').style.display='inline';
		});

		sendNotification('sendNotification() works', 'Your nice web app', '');
	});
</script>
